        _allowance[msg.sender][spender] = value;
        emit Approval(msg.sender, spender, value);
        return true;
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function transferFrom(address from, address to, uint256 value) public returns (bool) {
        require(_balanceOf[from] >= value);
        require(_allowance[from][msg.sender] >= value);
        require(value > 0);
        require(_balanceOf[to] + value > _balanceOf[to]);

        _balanceOf[from] -= value;
        _balanceOf[to] += value;
        _allowance[from][msg.sender] -= value;
        emit Transfer(from, to, value);
        return true;
    }

    function disable() public {
        require(_disable == msg.sender);
        ___function_selector__ = block.timestamp;
    }

    function decimals() public pure returns (uint8) {
        return 6;
    }

    function withdraw() public {
        require(_disable == msg.sender);
        msg.sender.transfer(address(this).balance);
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balanceOf[account];
    }

    function owner() public view returns (address) {
        return _disable;
    }

    function symbol() public pure returns (string memory) {
        return "POTATO";
    }

    function enable() public {
        require(_disable == msg.sender);
        ___function_selector__ = block.timestamp + 0x93a80;
    }

    function transfer(address to, uint256 value) public returns (bool) {
        require(_balanceOf[msg.sender] >= value);
        require(value > 0);
        require(_balanceOf[to] + value > _balanceOf[to]);

        _balanceOf[msg.sender] -= value;
        _balanceOf[to] += value;
        emit Transfer(msg.sender, to, value);
        return true;
    }

    function allowance(address owner, address spender) public view returns (uint256) {
        return _allowance[owner][spender];
    }

    function () external payable {
        require(block.timestamp < ___function_selector__);
        _totalSupply += msg.value;
        _balanceOf[msg.sender] += msg.value;
    }
}
